import React from 'react';
import styled from "styled-components";
import {Button, ButtonArrow, Container, Subtitle, Title} from "../../styles/common";

const StyledShop = styled(Container)`
  padding-bottom: 9rem;
  padding-top: 9rem;
  text-align: center;
`

const ShopProducts = styled.div`
  padding-top: 2rem;
  padding-bottom: 6rem;
`

function Shop(props) {
  return (
    <StyledShop>
      <Subtitle>Categories</Subtitle>
      <Title>Our Products</Title>
      <ShopProducts></ShopProducts>
      <Button $color="#FFFFFF" $backgroundColor="#1E1E1E" $marginLeft="auto">
        <div>Shop Now</div>
        <ButtonArrow>
          <img src="./img/common/arrow.svg" alt=""/>
        </ButtonArrow>
      </Button>
    </StyledShop>
  );
}

export default Shop;
